import React from "react";

function ListLow() {
  const winners = [
    {
      year: 2025,
      color: "warning",
      link: "/list2025",
      external: true,
    },
    {
      year: 2024,
      color: "primary",
      link: "https://drive.google.com/file/d/1FprgaHepKiWxxrJxRXHEqeRtlpe_z_ue/view?usp=sharing",
      external: false,
    },
  ];

  // Main Content
  React.createElement(
    "div",
    { className: "container py-5" },
    React.createElement(
      "div",
      { className: "row g-4" },
      winners.map((item) =>
        React.createElement(
          "div",
          { key: item.year, className: "col-md-6 col-lg-4" },
          React.createElement(
            "div",
            { className: "card h-100 shadow-sm text-center" },

            // Color Header
            React.createElement(
              "div",
              {
                className: `bg-${item.color} p-5`,
                style: { height: "120px" },
              },
              React.createElement("div", { className: "text-white fs-1" }, "üèÜ")
            ),

            // Card Body
            React.createElement(
              "div",
              {
                className:
                  "card-body d-flex flex-column justify-content-center align-items-center",
              },
              React.createElement(
                "h5",
                { className: "card-title fw-bold fs-4 mb-3" },
                item.year
              ),

              // Link internal / external
              item.external
                ? React.createElement(
                    "a",
                    {
                      href: item.link,
                      rel: "noopener noreferrer",
                      className: "btn btn-primary rounded-pill px-5",
                    },
                    "Open"
                  )
                : React.createElement(
                    "a",
                    {
                      href: item.link,
                      target: "_blank",
                      className: "btn btn-primary rounded-pill px-5",
                    },
                    "Open"
                  )
            )
          )
        )
      )
    )
  );
}

export default ListLow;
